import React from "react";
import "./Posts.css";
import Navbar from "../Navbar/Navbar";
import * as Unicons from "@iconscout/react-unicons";

function Posts()
{
    return(
        <div className = "Posts-Container align-center">
            <div className = "NavBar align-center">
                <Navbar />
            </div>
        </div>
    );
}

export default Posts;
